import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
// import classes from './Home.module.css'


const Home = () => {
  return (
    // <Card style={{ margin: 'auto', width: '400px' }} bg="secondary" text="white" className="text-center">
    //   <Card.Img variant="top" src="holder.js/100px180" />
    //   <Card.Body>
    //     <Card.Title>About Me</Card.Title>
    //     <Card.Text>Welcome to my demo page created with React and Bootstrap.</Card.Text>
    //     <Card.Text>This is just a simple CV page I did for fun and to practice basic React JS concepts.</Card.Text>
    //     <Card.Text>I started my journey as a web developer in 2019 and felt highly inclined towards FrontEnd
    //       development.</Card.Text>
    //     <Card.Text>I've always been passionate about the <b>UI/UX</b> we experience on a daily basis through Apps
    //       and webpages.</Card.Text>
    //     <Card.Text>I believe that high quality <b>UI/UX</b> can contribute to make our lives easier and bring joy while interacting with these tools.</Card.Text>
    //     <Card.Text>I hope I can achieve these goals in the FrontEnd world!</Card.Text>
    //     <Button style={{ margin: '0px 10px' }} variant="primary">Study</Button>
    //     <Button style={{ margin: '0px 10px' }} variant="primary">Work</Button>
    //   </Card.Body>
    // </Card >
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180" />
      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
          Some quick example text to build on the card title and make up the bulk of
          the card's content.
        </Card.Text>
        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  )
}

export default Home;


